
CREATE TABLE public.songs (
	"Song" varchar(50) NULL,
	"Artist" varchar(50) NULL,
	"Streams" int4 NULL,
	"Daily Streams" int4 NULL,
	"Genre" varchar(50) NULL,
	"Release Year" int4 NULL,
	"Peak Position" int4 NULL,
	"Weeks on Chart" int4 NULL,
	"Lyrics Sentiment" float4 NULL,
